import React from 'react';
import { StyleSheet, Text, View, Button } from 'react-native';

export default function dashboard({ navigation }) {
  return (
    <View style={styles.container}>
      <Text style={styles.labelStyle}>Welcome the Dashboard</Text>
      <Button title="Go Next >>" onPress={() => navigation.navigate('Landing')} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  labelStyle: {
    marginBottom: 20,
    fontWeight: 'bold',
    fontSize: 18,
  },
});
